import localStyles from "./Navbar.style";

const Navbar = (props) => {
    const localClasses = localStyles();

    return(
        <>
            <div className={localClasses.navbar}>
                <div className={localClasses.navbarHeader}>
                    <div>
                        <div className={localClasses.navbarHeaderSidebarToogle}>oi</div>
                    </div>
                </div>

                <div className={localClasses.navbarBody}>oi</div>
            </div>
        </>
    );
};

export default Navbar;
